CREATE TABLE public.artists
(
    id uuid PRIMARY KEY NOT NULL,
    name text,
    normalised_name text,
    aliases text
);
CREATE UNIQUE INDEX artists_id_uindex ON public.artists (id);
CREATE TABLE public.composers
(
    artist_id uuid,
    song_id uuid,
    CONSTRAINT composers_artists_id_fk FOREIGN KEY (artist_id) REFERENCES public.artists (id),
    CONSTRAINT composers_finalists_id_fk FOREIGN KEY (song_id) REFERENCES public.finalists (id)
);
CREATE TABLE public.contests
(
    id uuid PRIMARY KEY NOT NULL,
    img_src text,
    location text,
    name text,
    url text,
    year integer
);
CREATE UNIQUE INDEX contests_id_uindex ON public.contests (id);
CREATE TABLE public.finalists
(
    artist text,
    country text,
    points integer,
    performance_order integer,
    ranking integer,
    broadcaster text,
    composers text,
    contest_id uuid,
    final_type text,
    id uuid PRIMARY KEY NOT NULL,
    song text,
    writers text,
    CONSTRAINT finalists_contests_id_fk FOREIGN KEY (contest_id) REFERENCES public.contests (id)
);
CREATE UNIQUE INDEX finalists_id_uindex ON public.finalists (id);
CREATE TABLE public.performers
(
    artist_id uuid,
    song_id uuid,
    CONSTRAINT performers_artists_id_fk FOREIGN KEY (artist_id) REFERENCES public.artists (id),
    CONSTRAINT performers_finalists_id_fk FOREIGN KEY (song_id) REFERENCES public.finalists (id)
);
CREATE TABLE public.tags
(
    id uuid PRIMARY KEY NOT NULL,
    name text,
    aliases text
);
CREATE UNIQUE INDEX tags_id_uindex ON public.tags (id);
CREATE TABLE public.tags_conn
(
    song_id uuid,
    tag_id uuid,
    CONSTRAINT "tags-conn_finalists_id_fk" FOREIGN KEY (song_id) REFERENCES public.finalists (id),
    CONSTRAINT "tags-conn_tags_id_fk" FOREIGN KEY (tag_id) REFERENCES public.tags (id)
);
CREATE TABLE public.writers
(
    artist_id uuid,
    song_id uuid,
    CONSTRAINT writers_artists_id_fk FOREIGN KEY (artist_id) REFERENCES public.artists (id),
    CONSTRAINT writers_finalists_id_fk FOREIGN KEY (song_id) REFERENCES public.finalists (id)
);
